import React from "react";

function UserPage(){

    function handleSubmit(e){
        e.pre
    }

    return (
        <div>
            <h1>Hi this is a wildfire prediction</h1>
            <label>County: </label>
            <input type="text" name ="County" placeholder="Enter County"></input>
            <br></br>
            <label>Date: </label>
            <input type="date" name="datetime"></input>
            <br></br>
            <label>Temp: </label>
            <input type="float" name="temp" placeholder="Enter Temp in Celius"></input>
            <br></br>
            <label>Hum: </label>
            <input type="float" name="Hum" placeholder="Enter Hum in %"></input>
            <br></br>
            <form onSubmit={handleSubmit}>
            <button type="button" name= "submit">Sumbit</button>
            </form>
        </div>
    );
}

export default UserPage;
